'',
unistr('<p><strong>\039B\03AF\03C3\03C4\03B1 \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2</strong><br>'),
unistr('\03A4\03BF \03C0\03BB\03B1\03AF\03C3\03B9\03BF \03B4\03B9\03B1\03BB\03CC\03B3\03BF\03C5 "\03A4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7" \03B5\03BC\03C6\03B1\03BD\03AF\03B6\03B5\03B9 \03BC\03B9\03B1 \03BB\03AF\03C3\03C4\03B1 \03B4\03B9\03B1\03BC\03BF\03C1\03C6\03C9\03BC\03AD\03BD\03C9\03BD \03BA\03B1\03BD\03CC\03BD\03C9\03BD \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2.<br>'),
unistr('\039A\03AC\03BD\03C4\03B5 \03BA\03BB\03B9\03BA \03C3\03C4\03B7\03BD \03B5\03C0\03B9\03BB\03BF\03B3\03AE "\03A0\03C1\03BF\03C3\03B8\03AE\03BA\03B7" ( &plus; ) \03B3\03B9\03B1 \03BD\03B1 \03B4\03B7\03BC\03B9\03BF\03C5\03C1\03B3\03AE\03C3\03B5\03C4\03B5 \03BC\03B9\03B1 \03C3\03C4\03AE\03BB\03B7 \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2 \03AE \03C3\03C4\03B7\03BD \03B5\03C0\03B9\03BB\03BF\03B3\03AE "\0394\03B9\03B1\03B3\03C1\03B1\03C6\03AE" ( &minus; ) \03B3\03B9\03B1 \03BD\03B1 \03B1\03C6\03B1\03B9\03C1\03AD\03C3\03B5\03C4\03B5 \03BC\03B9\03B1 \03C3\03C4\03AE\03BB\03B7 \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2.<br>'),
unistr('\039A\03AC\03BD\03C4\03B5 \03BA\03BB\03B9\03BA \03C3\03C4\03B9\03C2 \03B5\03C0\03B9\03BB\03BF\03B3\03AD\03C2 "\039C\03B5\03C4\03B1\03BA\03AF\03BD\03B7\03C3\03B7 \03C0\03C1\03BF\03C2 \03C4\03B1 \03C0\03AC\03BD\03C9" ( &uarr; ) \03BA\03B1\03B9 "\039C\03B5\03C4\03B1\03BA\03AF\03BD\03B7\03C3\03B7 \03C0\03C1\03BF\03C2 \03C4\03B1 \03BA\03AC\03C4\03C9" ( &darr; ) \03B3\03B9\03B1 \03BD\03B1 \03BC\03B5\03C4\03B1\03BA\03B9\03BD\03AE\03C3\03B5\03C4\03B5 \03C4\03B7\03BD \03B5\03C0\03B9\03BB\03B5\03B3\03BC\03AD\03BD\03B7 \03C3\03C4\03AE\03BB\03B7 \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2 \03C0\03C1\03BF\03C2 \03C4\03B1 \03C0\03AC\03BD\03C9 \03BA\03B1\03B9 \03C0\03C1\03BF\03C2 \03C4\03B1 \03BA\03AC\03C4\03C9 \03C3\03B5 \03C3\03C7\03AD\03C3\03B7 \03BC\03B5 \03C4\03B9\03C2 \03AC\03BB\03BB\03B5\03C2 \03C3\03C4\03AE\03BB\03B5\03C2 \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2.</p>'),
'',
unistr('<p><strong>\03A1\03C5\03B8\03BC\03AF\03C3\03B5\03B9\03C2 \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2</strong><br>'),
unistr('\0395\03C0\03B9\03BB\03AD\03BE\03C4\03B5 \03BC\03B9\03B1 \03C3\03C4\03AE\03BB\03B7 \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2, \03C4\03B7\03BD \03BA\03B1\03C4\03B5\03CD\03B8\03C5\03BD\03C3\03B7 \03C4\03B7\03C2 \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2 \03BA\03B1\03B9 \03C4\03BF\03BD \03C4\03C1\03CC\03C0\03BF \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2 \03C4\03C9\03BD \03C3\03C4\03B7\03BB\03CE\03BD null (\03C3\03C4\03AE\03BB\03B5\03C2 \03C7\03C9\03C1\03AF\03C2 \03C4\03B9\03BC\03AE).</p>'),
'',
unistr('<p><em>\03A3\03B7\03BC\03B5\03AF\03C9\03C3\03B7: \03A4\03B1 \03B4\03B5\03B4\03BF\03BC\03AD\03BD\03B1 \03BC\03C0\03BF\03C1\03BF\03CD\03BD \03BD\03B1 \03C4\03B1\03BE\03B9\03BD\03BF\03BC\03B7\03B8\03BF\03CD\03BD \03BA\03B1\03C4\03AC \03C3\03C4\03AE\03BB\03B5\03C2 \03BF\03B9 \03BF\03C0\03BF\03AF\03B5\03C2 \03B4\03B5\03BD \03B5\03BC\03C6\03B1\03BD\03AF\03B6\03BF\03BD\03C4\03B1\03B9. \03A9\03C3\03C4\03CC\03C3\03BF, \03B5\03BD\03B4\03AD\03C7\03B5\03C4\03B1\03B9 \03BD\03B1 \03BC\03B7\03BD \03AD\03C7\03BF\03C5\03BD \03CC\03BB\03B5\03C2 \03BF\03B9 \03C3\03C4\03AE\03BB\03B5\03C2 \03B4\03C5\03BD\03B1\03C4\03CC\03C4\03B7\03C4\03B1 \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7\03C2.</em><br>'),
unistr('<em>\039F\03B9 \03B5\03BC\03C6\03B1\03BD\03B9\03B6\03CC\03BC\03B5\03BD\03B5\03C2 \03C3\03C4\03AE\03BB\03B5\03C2 \03BC\03C0\03BF\03C1\03BF\03CD\03BD \03BD\03B1 \03C4\03B1\03BE\03B9\03BD\03BF\03BC\03B7\03B8\03BF\03CD\03BD \03C0\03B1\03C4\03CE\03BD\03C4\03B1\03C2 \03C4\03BF \03C0\03AC\03BD\03C9 \03B2\03AD\03BB\03BF\03C2 (\03B1\03CD\03BE\03BF\03C5\03C3\03B1 \03C3\03B5\03B9\03C1\03AC) \03AE \03C4\03BF \03BA\03AC\03C4\03C9 \03B2\03AD\03BB\03BF\03C2 (\03C6\03B8\03AF\03BD\03BF\03C5\03C3\03B1 \03C3\03B5\03B9\03C1\03AC) \03C3\03C4\03BF \03C4\03AD\03BB\03BF\03C2 \03C4\03C9\03BD \03BA\03B5\03C6\03B1\03BB\03AF\03B4\03C9\03BD \03C3\03C4\03B7\03BB\03CE\03BD. \0393\03B9\03B1 \03BD\03B1 \03C0\03C1\03BF\03C3\03B8\03AD\03C3\03B5\03C4\03B5 \03BC\03B9\03B1 \03B5\03C0\03CC\03BC\03B5\03BD\03B7 \03C3\03C4\03AE\03BB\03B7 \03C3\03B5 \03BC\03B9\03B1 \03C5\03C0\03AC\03C1\03C7\03BF\03C5\03C3\03B1 \03C4\03B1\03BE\03B9\03BD\03CC\03BC\03B7\03C3\03B7, \03BA\03C1\03B1\03C4\03AE\03C3\03C4\03B5 \03C0\03B1\03C4\03B7\03BC\03AD\03BD\03BF \03C4\03BF \03C0\03BB\03AE\03BA\03C4\03C1\03BF ')
