,p_message_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
unistr('\039F\03B9 \03B4\03B9\03B1\03B4\03C1\03B1\03C3\03C4\03B9\03BA\03AD\03C2 \03B1\03BD\03B1\03C6\03BF\03C1\03AD\03C2 \03C0\03B1\03C1\03AD\03C7\03BF\03C5\03BD \03C3\03C4\03BF\03C5\03C2 \03C4\03B5\03BB\03B9\03BA\03BF\03CD\03C2 \03C7\03C1\03AE\03C3\03C4\03B5\03C2 \03C4\03B7 \03B4\03C5\03BD\03B1\03C4\03CC\03C4\03B7\03C4\03B1 \03C0\03C1\03BF\03C3\03B1\03C1\03BC\03BF\03B3\03AE\03C2 \03C4\03C9\03BD \03B1\03BD\03B1\03C6\03BF\03C1\03CE\03BD. \039F\03B9 \03C7\03C1\03AE\03C3\03C4\03B5\03C2 \03BC\03C0\03BF\03C1\03BF\03CD\03BD \03BD\03B1 \03C4\03C1\03BF\03C0\03BF\03C0\03BF\03B9\03BF\03CD\03BD \03C4\03B7 \03B4\03BF\03BC\03AE \03C4\03C9\03BD \03B4\03B5\03B4\03BF\03BC\03AD\03BD\03C9\03BD \03C4\03C9\03BD \03B1\03BD\03B1\03C6\03BF\03C1\03CE\03BD, \03B5\03C0\03B9\03BB\03AD\03B3\03BF\03BD\03C4\03B1\03C2 \03C3\03C4\03AE\03BB\03B5\03C2, \03B5\03C6\03B1\03C1\03BC\03CC\03B6\03BF\03BD\03C4\03B1\03C2 \03C6\03AF\03BB\03C4\03C1\03B1, \03B5\03C0\03B9\03C3\03B7\03BC\03B1\03AF\03BD\03BF\03BD\03C4\03B1\03C2 \03BA\03B1\03B9 \03C4\03B1\03BE\03B9\03BD\03BF\03BC\03CE\03BD\03C4\03B1\03C2 \03C4\03B9\03C2 \03C0\03BB\03B7\03C1\03BF\03C6')
